import React from "react";

import classes from "./Movie.module.css";

const Movie = (props) => {
  return (
    <li className={classes.movie}>
      <h2>{props.title[1]}</h2>
      <h3>{props.releaseDate[1]}</h3>
      <p>{props.openingText[1]}</p>
    </li>
  );
};

export default Movie;
